export function passwordValidator(password) {
  const capital = lower.charAt(0).toUpperCase() + lower.substring(1);
  if (!password || password.length <= 0) return "Error: Password can't be empty"
  if (!capital.test(password)) return 'Need Capital eltter'
  return ''
}
